import ProductSimilarTemizlik from "../Components/product/ProductSimilarTemizlik";
import TemizlikEldeBulasikYikamaMaddesi from "../Components/product/TemizlikEldeBulasikYikamaMaddesi";

function TemizlikEldeBulasikYikamaMaddesiPage() {
  return (
    <>
      <TemizlikEldeBulasikYikamaMaddesi />
      <ProductSimilarTemizlik />
    </>
  );
}

export default TemizlikEldeBulasikYikamaMaddesiPage;
